INSERT INTO KSLO_RICH_TEXT_T (VER_NBR, OBJ_ID, ID, FORMATTED, PLAIN) VALUES (0, '818cbabd-5118-4cbf-a0d5-c9738a59ac1a', 'c0d37b53-ed67-4db0-8aa9-6430ee0a08f4', 'Undergraduates will learn and develop information literacy skills that they can successfully apply within a wide range and intersection of disciplines inside and outside academia.', 'Undergraduates will learn and develop information literacy skills that they can successfully apply within a wide range and intersection of disciplines inside and outside academia.')
/
INSERT INTO KSLO_RICH_TEXT_T (VER_NBR, OBJ_ID, ID, FORMATTED, PLAIN) VALUES (0, 'bc5e811a-da3f-4d6e-9ceb-0447ae2bbd42', '1cde7b48-a2d2-4c0e-9c98-e58c6bf5fbdc', 'Undergraduates will be able to understand basic technologies and how these relate to their specific disciplines, and will be able to apply these technologies to their research and academic efforts.', 'Undergraduates will be able to understand basic technologies and how these relate to their specific disciplines, and will be able to apply these technologies to their research and academic efforts.')
/
INSERT INTO KSLO_RICH_TEXT_T (VER_NBR, OBJ_ID, ID, FORMATTED, PLAIN) VALUES (0, '563a97fd-f9dc-47c4-8cf6-8cee4f3dd375', '54754205-8d42-4bc4-aa96-c0a28e204f20', 'Undergraduates should learn and develop critical reasoning and research skills that they can apply successfully within a wide range and intersection of disciplines inside and outside of academia.', 'Undergraduates should learn and develop critical reasoning and research skills that they can apply successfully within a wide range and intersection of disciplines inside and outside of academia.')
/
INSERT INTO KSLO_RICH_TEXT_T (VER_NBR, OBJ_ID, ID, FORMATTED, PLAIN) VALUES (0, 'e85da1da-021f-4726-bb8b-600aaf4c99fb', '2c8107b4-d0a3-443b-b4af-c7a969d1b451', 'Using standard English, undergraduates will communicate clearly and effectively in writing and orally for different audiences and purposes.', 'Using standard English, undergraduates will communicate clearly and effectively in writing and orally for different audiences and purposes.')
/
INSERT INTO KSLO_RICH_TEXT_T (VER_NBR, OBJ_ID, ID, FORMATTED, PLAIN) VALUES (0, 'f977a8d8-7250-4dcd-b596-790b04733df0', '4e0ecb4d-13bc-4cf0-815c-767a3e5640a4', 'Undergraduates should understand and be able to apply basic scientific and mathematical reasoning to their research efforts and critical analyses.', 'Undergraduates should understand and be able to apply basic scientific and mathematical reasoning to their research efforts and critical analyses.')
/

